import axios from "axios";

const API_URL = "http://www.sgerd.com/api/usuario/";

const register = (email, password) => {
  return axios.post(API_URL + "registrousuario", {
    email,
    password,
  })
  .then((response) => {
    return response.data;
  });
};

const login = (email, password) => {
  return axios
    .post(API_URL + "iniciarsesion", {
      email,
      password,
    })
    .then((response) => {
      return response.data;
    });
};

const currenUser = () => {
  return axios
    .get(API_URL + "usuarioactual")
    .then((response) => {
      return response.data;
    });
};

const logout = () => {
  return axios.post(API_URL + "cerrarsesion");
};

export default {
  register,
  login,
  currenUser,
  logout,
};
